import React, { PureComponent } from "react";
import {
  Radar,
  RadarChart,
  PolarGrid,
  PolarAngleAxis,
  PolarRadiusAxis,
  Label,
} from "recharts";
import Data from "../Data/DimensionActive";
const data = Data;

export default class Example extends PureComponent {
  static jsfiddleUrl = "https://jsfiddle.net/alidingling/6ebcxbx4/";

  render() {
    return (
      <RadarChart outerRadius={140} width={500} height={340} data={data}>
        <PolarGrid />
        <Label
          value="คะแนนดิบในมิติกิจกรรมการทำงาน"
          offset={0}
          position="top"
          font-family="Prompt"
        />
        <PolarAngleAxis dataKey="subject" font-family="Prompt" />
        <PolarRadiusAxis angle={30} domain={[-100, 100]} />
        <Radar
          font-family="Prompt"
          name="กิจกรรมการทำงาน"
          dataKey="d0"
          stroke="#8884d8"
          fill="#8884d8"
          fillOpacity={0.6}
        />
      </RadarChart>
    );
  }
}
